              SELECTION OF ELIGIBLE CANDIDATES
              Based on the criteria specified by the company the students database is filtered and the eligible students list is created and forwarded to the company. After the companies selection process the students will be placed
              
              PLACEMENT CELL ACTIVITIES
              The Department of computer science has a placement cell comprising of the placement coordinator and student representatives from final year MCA. It maintains a database of prospective employers for placement opportunities and future communications. The cell also manages campus recruitments and arranges employers visit to the campus to interact with the graduating students and the subsequent recruitment process.</div>
