          <p class="card-text">DEPT. OF COMPUTER SCIENCE:
            The Department commenced its three year (six semesters) Master of Computer Applications (MCA) Programme in 2001. Affiliated to Mahatma Gandhi University, Kottayam, Kerala, India, and approved by the All India Council for Technical Education, New Delhi, the course is designed to meet the ever-growing demand for well qualified and trained computer programmers. The Department has been consecutively rated Platinum by the AICTE-CII survey, for its illustrious placement track record and distinctive industry interaction programmes. The various specialisations of the MCA programme at RCSS brings out the students as world class professionals, suitable for the software industry.
            The new programme MSc Computer Science (Data Analytics), affiliated to M G University, starting from the academic year 2020-21, is the recent initiative by the Department of Computer Science in the emerging field of Data Science.
            *From 2020 Admission onwards, Master of Computer Applications(MCA) will be a 2-year course as per APH 2020-21 of AICTE, New Delhi.
